	A = Matrix(K2,[[0]*128]*128)
	for k in range(11):
		A += M_round**(10-k)*M_key_exp[k]
	R_10 = M_round**10   
	RP = matrixMul(R_10,P,Corr,n)
	Y = add(RP,C,n)
	A_e = A.echelon_form()
